   "source": [
    "# Task1:\n",
    "Classification is a supervised machine learning technique where the goal is to predict the categorical class labels of new instances based on past observations. One of the most crucial steps in classification, as in any machine learning task, is data cleaning and preparation. This process involves handling missing values, removing outliers, normalizing or standardizing features, and encoding categorical variables, among other tasks. Ensuring that the data is clean and well-prepared is essential for building accurate and reliable classification models, as the quality of the input data directly impacts the performance and generalisation ability of the models.\n",
    "\n",
    "\n",
    "\n",
    "\n"
   ]
