   "source": [
    "##### The ideal data for machine learning classification has three key attributes: it is accurately labeled to provide ground truth, diverse to enable generalisation, and high quality to minimise noise and errors. Proper preprocessing and feature engineering can also improve model performance. Overall, a combination of labeled, diverse, high-quality data enables robust classifier training.\n",
    "\n",
    "##### Machine learning tasks often involve dealing with various types of data, including:\n",
    "\n",
    "##### Numerical Data: This includes measurements or counts that can be quantified on a numerical scale, such as age, cholesterol levels, and blood pressure. This involves both continuous and discrete variables. Numerical data often undertakes preprocessing techniques like normalisation (scaling all numeric features to a fixed range, e.g., 0 to 1. usually involves substracting value from min and dividing it by max - min value) and standardisation (scaling data by subtraction from mean and dividing by standard deviation) to ensure that all features contribute equally to the model.\n",
    "\n",
    "##### Categorical Data: This can be further divided into:\n",
    "   ##### Nominal Data: Categories without a natural order or ranking, such as sex (male or female), prescribed_drugs, smoking status (yes or no), and chest pain type (typical angina, atypical angina, non-anginal pain, asymptomatic). Nominal data often requires encoding to convert these categories into a format that machine learning algorithms can understand, such as one-hot encoding, which creates a new binary column for each value of the category.\n",
    " ##### Ordinal Data: Categories that have a natural order or ranking but are not measured on a numeric scale, such as education level (high school, bachelor's, master's, doctorate) or T-shirt size (small, medium, large). Ordinal data can be handled with integer encoding, where each category is assigned a unique integer based on its rank, or by using more sophisticated encoding techniques that preserve the order information.\n",
    "\n",
    "##### Properly handling both numerical and categorical data, considering their specific characteristics and preprocessing needs, is crucial for the success of machine learning models. This ensures that the model accurately captures the patterns in the data without being misled by the scale or format of the features.\n",
    "\n",
    "G. Cerulli, ‘The Basics of Machine Learning’, in Fundamentals of Supervised Machine Learning: With Applications in Python, R, and Stata, G. Cerulli, Ed., in Statistics and Computing. , Cham: Springer International Publishing, 2023, pp. 1–17. doi: 10.1007/978-3-031-41337-7_1."
   ]
