   "source": [
    "In R, factors provide a convenient way to handle categorical data by assigning integer labels to unique levels of a categorical variable. For binary categories like \"yes\" and \"no,\" factors can represent them as 1 and 0, respectively, simplifying classification tasks. However, to maintain consistency and uniformity across programming languages, it's common practice to convert categorical values to binary representations directly. For multi-category variables, one-hot encoding expands the categorical variable and its importance into multiple binary columns, each value representing a unique category. This approach preserves the categorical information while ensuring compatibility with binary classification algorithms. Factors in R offer flexibility in handling categorical data efficiently, facilitating meaningful analysis and interpretation. One-hot encoding is used on prescribed drugs and thalium test (nominal categories) results while normalisation is used for flouroscopy results which is the number of blood vessels that are dyed showing defect. For the number of blood vessels illuminated with fluoroscopy results, since the values are ordinal and represent discrete categories (0, 1, 2, 3), one-hot encoding would not be the best approach. One-hot encoding is typically used for nominal categorical variables where there is no inherent order or magnitude between the categories. Normalisation scales the numerical values to a range between 0 and 1, which can help prevent features with larger magnitudes from dominating the model training process. In this case, min-max scaling to normalise the values of the number of blood vessels to the range [0, 1]. This way, each value would retain its ordinal relationship with the others while being scaled appropriately for machine learning algorithms."
   ]
  },
