    "In the final part of the analysis, after handling categorical variables, attention shifts to numerical values. It's important to differentiate between normalisation and standardisation (scaling) techniques. The script's normalise function adjusts numerical data to a 0 to 1 range, using the minimum and maximum values for scaling. This is mathematically different to the scale function in R, which implements z-score standardisation, centering data around a mean of 0 and adjusting based on standard deviation. While both approaches could be theoretically valid, empirical evidence from the Random Forest classification suggests that accuracy may not improve with the scaling or normalisation of continuous variables. This insight underscores a notable aspect of Random Forest algorithms: they are generally less sensitive to the scale of variables compared to models like SVM or logistic regression, which makes preprocessing steps like normalisation or standardisation less critical for achieving high model performance. However, the assertion that accuracy is higher without any form of scaling or normalisation for continuous variables should be considered with caution, as this can vary depending on the specific dataset and models used.\n",
