    "\n",
    "In machine learning, various relationships that play a significant role in model development and evaluation. One crucial trade-off arises when deciding when to halt model training, striking a balance between underfitting and overfitting. This decision often involves monitoring performance metrics such as accuracy or loss on a validation set over epochs, aiming to stop training at the point where the model generalises well to unseen data without memorising the training set. Moreover, there's a question of prioritising sensitivity or specificity (nicely visualised by ROC curve), particularly in binary classification tasks. Sensitivity ensures accurate detection of positive cases, while specificity focuses on negative predictions. Finding the right balance depends on the application context. Additionally, there are considerations between reducing data size and maintaining data fidelity when handling duplicates and missing values. Imputing missing values with zero or other metrics can introduce bias, affecting model performance. \n",
    "There is a trade-off between bias and variance where bias is improved by more samples, variance would improve by removing featurs with less importance. \n",
    "https://www.geeksforgeeks.org/ml-bias-variance-trade-off/\n",
    "https://www.statology.org/bias-variance-tradeoff/\n",
