    "#Split data into training and testing sets\n",
    "set.seed(123)  # Set seed for reproducibility\n",
    "trainIndex <- createDataPartition(data$heart_disease_diagnosis, p = 0.8, list = FALSE)\n",
    "trainData <- data[trainIndex, ]\n",
    "testData <- data[-trainIndex, ]\n",
    "\n",
    "#split the training and test data into features and labels\n",
    "# Extract labels from training data\n",
    "trainLabels <- trainData$heart_disease_diagnosis\n",
    "trainLabels <- as.factor(trainLabels)\n",
    "\n",
    "# Remove labels from training data\n",
    "trainFeatures <- trainData[, -which(names(trainData) == \"heart_disease_diagnosis\")]\n",
    "\n",
    "# Extract labels from testing data\n",
    "testLabels <- testData$heart_disease_diagnosis\n",
    "testLabels <- as.factor(testLabels)\n",
    "# Remove labels from testing data\n",
    "testFeatures <- testData[, -which(names(testData) == \"heart_disease_diagnosis\")]\n"
   ]
