    "\n",
    "#### Random Forest is a powerful ensemble learning method that combines the predictions of multiple decision trees to enhance accuracy and stability in both classification and regression tasks. By building numerous decision trees from bootstrap samples of the training data and introducing randomness in feature selection at each split, Random Forest reduces overfitting and increases robustness compared to individual trees. Its ability to handle large datasets with high dimensionality and missing values makes it versatile for various applications in industries like finance, healthcare, and e-commerce.\n",
    "\n",
    "#### Despite its effectiveness, Random Forest has limitations. It can be computationally intensive, especially with large datasets and a high number of trees, leading to longer training times. While it's less prone to overfitting than individual trees, it can still overfit noisy data. Additionally, interpreting Random Forest models can be challenging due to their complexity and the need to consider multiple trees. Random forest model was chosen as it performs well when features are not dependant on each other such as (smoking and age) \n",
    "\n",
