    "#### What is another measure of accuracy commonly used? Explanation of metrics other than accuracy and ROC curve:\n",
    "  - Precision: The proportion of true positive predictions out of all positive predictions made by the model. It indicates the accuracy of positive predictions.\n",
    "  - Recall: Also known as sensitivity, it measures the proportion of actual positives that were correctly predicted by the model.\n",
    "  - F1 Score: The harmonic mean of precision and recall. It provides a balance between precision and recall, especially when the classes are imbalanced.\n"
