    "#https://stackoverflow.com/questions/11467855/roc-curve-in-r-using-rocr-package\n",
    "# Create a prediction object\n",
    "pred <- prediction(as.numeric(predictions), as.numeric(testLabels))\n",
    "\n",
    "# Create a performance object for the ROC curve\n",
    "perf <- performance(pred, \"tpr\", \"fpr\")\n",
    "\n",
    "# Create a performance object for AUC calculation\n",
    "perf_auc <- performance(pred, measure = \"auc\")\n",
    "auc_value <- perf_auc@y.values[[1]]  # Extracting the AUC value\n",
    "\n",
    "# Plot the ROC curve\n",
    "plot(perf, colorize = TRUE, main = paste(\"ROC Curve (AUC =\", round(auc_value, 4), \")\"), xlab = \"False Positive Rate\", ylab = \"True Positive Rate\")\n",
    "\n",
    "# Add a line representing random chance\n",
    "abline(a = 0, b = 1, col = \"forestgreen\", lwd = 2, lty = 2)\n",
    "\n",
    "# Add legend\n",
    "legend(\"bottomright\", \n",
    "       legend = \"Random Classification\", \n",
    "       col = \"forestgreen\", \n",
    "       lty = 2, \n",
    "       text.font = 2,  \n",
    "       bg = \"white\",   # Background color\n",
    "       inset = 0.05,   # Adjust inset for position\n",
    "       text.width = 0.35  # Adjust the width of the legend text\n",
    ")"
   ]
