   "source": [
    "## Logistic Regression:\n",
    "\n",
    "Logistic regression is a statistical analysis method primarily used for predicting the outcome of a binary dependent variable based on one or more independent variables. It operates by estimating the probabilities of the binary outcomes through a logistic function, ensuring predictions fall between 0 and 1. Unlike linear regression, logistic regression does not require the dependent variable to be linearly related to the independent ones but assumes a linear relationship between the log odds of the outcome and the independent variables. Logistic regression helps in understanding how various factors contribute to the probability of a particular outcome, such as disease presence, customer behaviours, or voting behavior. The method is popular for its interpretability, with coefficients indicating the strength and direction of the association between predictors and the outcome. However, it necessitates careful consideration of its assumptions, including the independence of observations and the linearity of log odds, to ensure the validity of its predictions.\n",
    "https://www.statology.org/logistic-regression-in-r/"
   ]
  },
