   "source": [
    "# Fit the logistic regression model\n",
    "logistic_model <- glm(trainLabels ~ ., data = trainFeatures, family = binomial)\n",
    "\n",
    "# Extract coefficients from the model, excluding the intercept\n",
    "coefficients <- coef(logistic_model)[-1]\n",
    "\n",
    "# Calculate the absolute values of the coefficients\n",
    "abs_coefficients <- abs(coefficients)\n",
    "\n",
    "# Sort the coefficients by their absolute value in decreasing order\n",
    "sorted_indices <- order(abs_coefficients, decreasing = TRUE)\n",
    "\n",
    "# Extract the top 10 most important features and their coefficients\n",
    "top_10_features <- names(coefficients)[sorted_indices][1:10]\n",
    "top_10_coefficients <- coefficients[sorted_indices][1:10]\n",
    "\n",
    "# Print the top 10 most important features and their coefficients\n",
    "cat(\"Top 10 most important features and their coefficients:\\n\")\n",
    "for (i in 1:10) {\n",
    "  cat(top_10_features[i], \":\", top_10_coefficients[i], \"\\n\")\n",
    "}\n"
   ]
