   "source": [
    "# Assuming 'top_10_features' and 'top_10_coefficients' are defined as before\n",
    "features_data <- data.frame(\n",
    "  Feature = top_10_features,\n",
    "  Importance = top_10_coefficients,\n",
    "  Correlation = ifelse(top_10_coefficients > 0, \"Positive Correlation\", \"Negative Correlation\")\n",
    ")\n",
    "\n",
    "# Create the plot\n",
    "ggplot(features_data, aes(x = reorder(Feature, Importance), y = Importance, fill = Correlation)) +\n",
    "  geom_bar(stat = \"identity\", position = \"dodge\") +\n",
    "  coord_flip() + # Make the plot horizontal\n",
    "  geom_text(aes(label = sprintf(\"%.2f\", Importance)), hjust = -0.2, size = 3.5) + # Annotate bars with coefficient values\n",
    "  scale_fill_manual(values = c(\"Positive Correlation\" = \"green\", \"Negative Correlation\" = \"red\")) + # Custom fill colors\n",
    "  labs(title = \"Top 10 Most Important Features\",\n",
    "       x = \"Feature\",\n",
    "       y = \"Importance (Coefficient Value)\") +\n",
    "  theme_minimal() +\n",
    "  theme(legend.title = element_blank()) # Improve legend\n",
    "\n",
    "\n",
    "options(repr.plot.width = 15, repr.plot.height = 15)\n",
    "\n",
    "# Display the plot"
   ]
  },
