    "# Predict new features\n",
    "predicted_probabilities <- predict(logistic_model, newdata = testFeatures, type = \"response\")\n",
    "\n",
    "# Convert predicted probabilities to binary predictions\n",
    "predictions <- ifelse(predicted_probabilities > 0.5, 1, 0)\n",
    "\n",
    "# Create a prediction object\n",
    "pred <- prediction(predicted_probabilities, testLabels)\n",
    "\n",
    "# Create a performance object\n",
    "perf <- performance(pred, \"tpr\", \"fpr\")\n",
    "\n",
    "# Plot the ROC curve\n",
    "plot(perf, main = \"ROC Curve for Logistic Regression Model\", col = \"blue\", lwd = 2)\n",
    "# Add line representing random classification\n",
    "abline(a = 0, b = 1, col = \"gray\", lty = 2)\n",
    "\n",
    "# Add legend\n",
    "legend(\"bottomright\", \n",
    "       legend = \"Random Classification\", \n",
    "       col = \"gray\", \n",
    "       lty = 2, \n",
    "       text.font = 2,  \n",
    "       bg = \"white\",   # Background color\n",
    "       inset = 0.05,   # Adjust inset for position\n",
    "       text.width = 0.35  # Adjust the width of the legend text\n",
    ")\n",
    "# Calculate AUC\n",
    "auc <- performance(pred, \"auc\")\n",
    "cat(\"AUC:\", as.numeric(auc@y.values), \"\\n\") \n",
    "\n",
    "# Create the confusion matrix\n",
    "conf_matrix <- table(testLabels, predictions)\n",
    "print(conf_matrix)\n",
    "\n",
    "# Calculate accuracy\n",
    "accuracy <- sum(diag(conf_matrix)) / sum(conf_matrix)\n",
    "cat(\"Accuracy:\", accuracy, \"\\n\")\n",
    "\n",
    "# Calculate sensitivity (True Positive Rate)\n",
    "sensitivity <- conf_matrix[2, 2] / sum(conf_matrix[2, ])\n",
    "cat(\"Sensitivity (True Positive Rate):\", sensitivity, \"\\n\")\n",
    "\n",
    "# Calculate specificity (True Negative Rate)\n",
    "specificity <- conf_matrix[1, 1] / sum(conf_matrix[1, ])\n",
    "cat(\"Specificity (True Negative Rate):\", specificity, \"\\n\")"
   ]
