    "# Correctly extract coefficients for a linear SVM\n",
    "# Assuming 'svm_model' is trained with a linear kernel\n",
    "# The coefficients associated with the support vectors can be accessed as follows:\n",
    "coef_values <- coef(svm_model)\n",
    "print(coef_values)\n",
    "# The intercept can be accessed from the model's `rho` attribute\n",
    "intercept <- -svm_model$rho\n",
    "\n",
    "# Accessing feature names\n",
    "feature_names <- colnames(trainFeatures)\n",
    "\n",
    "# The correct way to map coefficients to feature names for a linear SVM:\n",
    "# Note: For linear SVM, the coef_values will include the weights for each feature\n",
    "# Adjust the length of feature_names if necessary to match the length of coef_values\n",
    "if (length(coef_values) > length(feature_names)) {\n",
    "    coef_values <- coef_values[-1]  # Assuming the first value corresponds to the intercept and adjusting accordingly\n",
    "}\n",
    "\n",
    "# Create a dataframe of feature names and their corresponding coefficients\n",
    "feature_coefficients <- data.frame(feature = feature_names, coefficient = coef_values)\n",
    "\n",
    "# Sort features by the absolute value of their coefficients in descending order\n",
    "sorted_features <- feature_coefficients[order(abs(feature_coefficients$coefficient), decreasing = TRUE), ]\n",
    "\n",
    "# Display the top N most important features\n",
    "top_n <- 10  # Adjust this value as needed\n",
    "head(sorted_features, top_n)\n"
   ]
