    "*** . Now choose one classifier to further optimize. **Random Forest**\n",
    "1. Why did you choose this classifier over the other? **We choose Random Forest over Support Vector Machines (SVM) and Logistic Regression for several reasons, especially in scenarios involving complex datasets with high dimensionality, non-linear relationships, and interactions among features. Random Forest, an ensemble learning method that constructs multiple decision trees, excels in handling overfitting, a common challenge in high-dimensional spaces. Its ability to average out biases, reduce variance, and improve prediction accuracy makes it robust against overfitting compared to SVM and Logistic Regression, which might struggle with non-linear data without kernel tricks or feature engineering. Moreover, Random Forest can naturally handle mixed data types (numerical and categorical) without the need for extensive preprocessing required by SVM and Logistic Regression. It also provides useful insights into feature importance, aiding in understanding the driving factors behind predictions. While SVM is powerful for finding the optimal hyperplane in high-dimensional space and Logistic Regression is favored for its simplicity and interpretability in binary classification tasks, Random Forest offers a versatile, less assumption-constrained approach. This model simply performed better than other models presenting a relatively accurate model with balanced sensitivity and specificity rather than sacrificng specificity for slightly higher sensetivity**\n",
    "2. Explain how this classifier works from a theoretical point of view – try to include as\n",
    "much detail as possible. **Random Forest is a powerful ensemble learning method that combines the predictions of multiple decision trees to enhance accuracy and stability in both classification and regression tasks. By building numerous decision trees from bootstrap samples of the training data and introducing randomness in feature selection at each split, Random Forest reduces overfitting and increases robustness compared to individual trees. Its ability to handle large datasets with high dimensionality and missing values makes it versatile for various applications in industries like finance, healthcare, and e-commerce. In this approach, multiple decision trees are built using bootstrapped samples from the original dataset. However, what sets random forests apart is the introduction of randomness in the feature selection process. Rather than considering all predictors at each split, only a random subset of predictors, typically denoted as m, is evaluated as split candidates. This injection of randomness helps decorrelate the individual trees within the forest, resulting in a more diverse and reliable ensemble. By averaging the predictions of these trees, the final model achieves a lower test error rate compared to traditional bagging methods. A common practice is to set m to the square root of the total number of predictors, ensuring a balanced exploration of feature space while maintaining model stability. For instance, if a dataset contains 16 predictors, m would be set to the square root of 16, which equals 4, limiting the consideration of split candidates to a subset of four predictors at each split.\n",
    "Out-of-bag (OOB) error estimation in random forests provides a convenient and efficient method for evaluating model performance without the need for traditional validation techniques like cross-validation. By utilising out-of-bag samples, which are not included in the training process of individual decision trees, OOB estimation allows for the calculation of an error rate that serves as a reliable estimate of the model's performance on unseen data. This approach offers computational efficiency, particularly with large datasets, while still providing accurate assessments of model accuracy. While random forests offer improved accuracy over single decision trees and are robust to outliers, they can be challenging to interpret due to their complexity and the need to consider multiple trees. Also,it may have longer training times.**\n",
    "\n",
    "\n",
    "**Fundamentals and Mechanism:\n",
    "Random Forest operates on the principle of ensemble learning, where multiple learners (decision trees, in this case) are combined to solve a problem more effectively than a single learner could. It constructs numerous decision trees during training and outputs the mode of the classes (classification) or mean prediction (regression) of the individual trees.\n",
    "Randomness is injected in two main ways:\n",
    "Bootstrap sampling: Each tree is trained on a random sample of the data drawn with replacement, known as a bootstrap sample. This ensures diverse training sets for each tree.\n",
    "    Feature selection: At each split in the tree, a random subset of features is considered. This prevents trees from being too correlated and reduces variance.**\n",
    "\n",
    "**Advantages:\n",
    "By averaging numerous trees, it generally achieves higher accuracy than individual decision trees.It handles outliers and noise well.\n",
    "Works well for both classification and regression tasks and can handle datasets with a mixture of numerical and categorical features.\n",
    "Random Forest can provide insights into feature importance, which helps in understanding the driving factors behind predictions.**\n",
    "\n",
    "**Limitations:\n",
    "Training multiple trees, especially for large datasets, can be resource-intensive and time-consuming (Computational Complexity).\n",
    " The complexity of having multiple trees makes the model more like a \"black box\", challenging to interpret compared to simpler models like linear regression (lower interpretability).\n",
    "Though it's less prone to overfitting, it can still overfit particularly noisy datasets. Proper tuning of parameters like the number of trees and tree depth is crucial.**\n",
    "\n",
    "**While Random Forest models are generally considered challenging to interpret, tools and techniques like feature importance scores, Partial Dependence Plots (PDP), and SHAP values can provide insights into the model's decision-making process.\n",
    "    Dependency Among Features: Although Random Forest can handle independent features well, it also copes relatively well with dependent features due to its ensemble nature and the method of considering only a subset of features at each split. This can allow it to capture complex interactions between features to some extent. The performance of a Random Forest model can significantly depend on the tuning of its hyperparameters.**\n",
    "R. Genuer and J.-M. Poggi, ‘Random Forests’, in Random Forests with R, Cham: Springer International Publishing, 2020, pp. 33–55. doi: 10.1007/978-3-030-56485-8_3.**\n",
    "3. Try to optimize the classifier to achieve a higher accuracy (no matter how small) than\n",
    "first found. Remember that we have a particular focus on predicting those that\n",
    "develop heart disease (**This emphasises the importance of maximising and prioritising sensitivity in the analysis.it's crucial to consider the implications of false positives (predicting heart disease when there is none) and false negatives (failing to detect heart disease when it is present). In the case of medical diagnostics,minimising false negatives is often prioritised.**)\n",
    "a. Were there any features that could be removed? Please print the output that\n",
    "helped you make this decision. **Based on most important features (gini-index) the least important features (typical_angina, downslope_exercise_ST, left_ventricular_hypertrophy_ecg_results) are removed to reduce data that is not helping with the decision making. Pruning in machine learning and search algorithms involves trimming down decision trees to eliminate non-essential and redundant parts. This technique simplifies the decision tree, enhancing its prediction accuracy by reducing overfitting and decreasing the model's complexity. In  our case removal of aforementioned features did not help increasing the accuracy**\n",
    "b. Did changing the way data is sampled during training/testing affect the\n",
    "accuracy? **yes it comes as a very important part of machine learning and this was answered extensively after the first classifier in task 1 where optimal data sampling technique was chosen based on accuracy. 85-15 training-testing split was determined as the optimal number based on accuracy and F1 score**\n",
    "c. What about some of the internal parameters specific to the classifier? Please\n",
    "explain how one of these parameters can affect accuracy https://www.rdocumentation.org/packages/randomForest/versions/4.7-1.1/topics/randomForest\n",
    "\n",
    "**In the context of using the randomForest package in R, one critical parameter is mtry, which represents the number of variables randomly sampled as candidates at each split.\n",
    "mtry is the parameter for the number of features to consider when looking for the best split at each node of a tree. By default, its value is set to √p for classification tasks and p/3 for regression tasks, where p is the number of variables in the input data x.\n",
    "Impact on Accuracy: Adjusting mtry can significantly influence the model's performance. A lower mtry increases the diversity among the trees in the forest, potentially reducing overfitting and improving model accuracy, especially for noisy data. Conversely, a higher mtry might allow individual trees to better capture the underlying patterns, which could be beneficial for relatively clean and less complex datasets. However, setting mtry too high can make the trees too similar to each other, reducing the benefit of bagging in the random forest and possibly leading to overfitting.\n",
    "Other Important Hyperparameters in Random Forest\n",
    "ntree: Number of trees to grow. Increasing ntree can improve model accuracy up to a point, beyond which improvements are marginal, and computational costs increase.\n",
    "nodesize: Minimum size of terminal nodes. Larger values result in larger, more complex trees, potentially capturing more detailed patterns at the risk of overfitting.\n",
    "  maxnodes: Maximum number of terminal nodes trees in the forest can have, controlling the trees' depth and complexity.\n",
    "sampsize: Size of the sample to draw from the input data for growing each tree. Stratified sampling can be achieved if sampsize is a vector of the length of the number of strata.\n",
    "    replace: Indicates whether sampling of cases should be done with or without replacement. Affecting the diversity of the trees and, consequently, the model's variance.\n",
    "    For this assignment mtry, node size and ntree hyperparameters are focus on to improve the model's performance. different data sampling techniques were demonstrated in task 1 changing performance of the models.**"
