    "# Define the ntree values to iterate over\n",
    "ntree_values <- c(10, 20, 30, 40, 50, 100, 200,400,450, 500,550,600,1000)\n",
    "\n",
    "# Initialize a list to store evaluation metrics for each model\n",
    "metrics_list <- list()\n",
    "\n",
    "# Loop over ntree values\n",
    "for (ntree in ntree_values) {\n",
    "  # Train the Random Forest model\n",
    "  rf_model <- randomForest(trainLabels ~ ., data = trainFeatures, mtry = floor(ncol(trainFeatures)/3), ntree = ntree, type = 'classification')\n",
    "  \n",
    "  # Make predictions on the test set\n",
    "  predictions <- predict(rf_model, testFeatures)\n",
    "  \n",
    "  # Create confusion matrix\n",
    "  conf_matrix <- table(testLabels, predictions)\n",
    "  \n",
    "  # Extract evaluation metrics\n",
    "  TP <- conf_matrix[2, 2]\n",
    "  TN <- conf_matrix[1, 1]\n",
    "  FP <- conf_matrix[1, 2]\n",
    "  FN <- conf_matrix[2, 1]\n",
    "  sensitivity <- TP / (TP + FN)\n",
    "  specificity <- TN / (TN + FP)\n",
    "  accuracy <- (TP + TN) / sum(conf_matrix)\n",
    "  precision <- TP / (TP + FP)\n",
    "  recall <- sensitivity\n",
    "  f1_score <- 2 * (precision * recall) / (precision + recall)\n",
    "  \n",
    "  # Store metrics\n",
    "  metrics_list[[paste(\"ntree\", ntree)]] <- c(Sensitivity=sensitivity, Specificity=specificity, Accuracy=accuracy, Precision=precision, F1_Score=f1_score)\n",
    "}\n",
    "\n",
    "# Print the evaluation metrics for each ntree value\n",
    "for (ntree in names(metrics_list)) {\n",
    "  cat(ntree, \"\\n\")\n",
    "  print(metrics_list[[ntree]])\n",
    "  cat(\"\\n\")\n",
    "}\n"
   ]
