   "source": [
    "# Define the ntree values to iterate over\n",
    "ntree_values <- c(10, 20, 30, 40, 50, 100, 200, 500)\n",
    "\n",
    "# Placeholder to store accuracies\n",
    "accuracies <- numeric(length(ntree_values))\n",
    "\n",
    "# Loop through each ntree value\n",
    "for (i in seq_along(ntree_values)) {\n",
    "  ntree <- ntree_values[i]\n",
    "  \n",
    "  # Train the Random Forest model with current ntree value\n",
    "  rf_model <- randomForest(trainLabels ~ ., data = trainFeatures, \n",
    "                           mtry = floor(ncol(trainFeatures)/3), \n",
    "                           ntree = ntree, \n",
    "                           nodesize = 5, # Example value, adjust as needed\n",
    "                           type = 'classification')\n",
    "  \n",
    "  # Make predictions on the test set\n",
    "  predictions <- predict(rf_model, testFeatures)\n",
    "  \n",
    "  # Create confusion matrix\n",
    "  conf_matrix <- table(testLabels, predictions)\n",
    "  \n",
    "  # Calculate accuracy and store it\n",
    "  accuracy <- sum(diag(conf_matrix)) / sum(conf_matrix)\n",
    "  accuracies[i] <- accuracy\n",
    "  \n",
    "  # Print the ntree and corresponding accuracy\n",
    "  cat(\"ntree:\", ntree, \"- Accuracy:\", accuracy, \"\\n\")\n",
    "}\n",
    "\n",
    "# Optionally, plot the accuracies for visual comparison\n",
    "plot(ntree_values, accuracies, type = 'b', xlab = \"Number of Trees (ntree)\", ylab = \"Accuracy\", main = \"Random Forest Accuracy by ntree\")\n"
   ]
  },
