   "source": [
    "#### Interesting insight here is even though this task is a classification problem and based on the litretature the recomended mtry for classification is square root of the fearure number the accuracy was higher when mtry for regression was used which is number of features divided by 3. the default for the random forest is in regression as the results are equal to the default classifier so far \n",
    "\n",
    "#### Random forests’ tuning parameter is the number of randomly selected predictors, k, to choose from at each split, and is commonly referred to as mtry. In the regression context, Breiman (2001) recommends setting mtry to be one-third of the number of predictors.\n",
    "\n",
    "— Page 199, Applied Predictive Modeling, 2013.\n",
    "https://machinelearningmastery.com/random-forest-ensemble-in-python/#:~:text=Random%20forests%E2%80%99%20tuning%20parameter%20is%20the%20number%20of,to%20be%20one-third%20of%20the%20number%20of%20predictors.\n",
    "\n",
