   "source": [
    "# Assuming trainLabels, trainFeatures, and testFeatures are already defined\n",
    "\n",
    "# Define the range of nodesize values to explore\n",
    "nodesize_values <- seq(1, 20, by = 1) # Example range; adjust as needed\n",
    "\n",
    "# Initialize an empty vector to store accuracy for each nodesize\n",
    "accuracies <- numeric(length(nodesize_values))\n",
    "\n",
    "# Loop through each nodesize value\n",
    "for (i in seq_along(nodesize_values)) {\n",
    "  nodesize <- nodesize_values[i]\n",
    "  \n",
    "  # Train the Random Forest model with the current nodesize\n",
    "  rf_model <- randomForest(trainLabels ~ ., data = trainFeatures, \n",
    "                           mtry = floor(ncol(trainFeatures)/3), \n",
    "                           ntree = 500, \n",
    "                           nodesize = nodesize,\n",
    "                           type = 'classification')\n",
    "  \n",
    "  # Make predictions on the test set\n",
    "  predictions <- predict(rf_model, testFeatures)\n",
    "  \n",
    "  # Create confusion matrix\n",
    "  conf_matrix <- table(testLabels, predictions)\n",
    "  \n",
    "  # Calculate accuracy\n",
    "  accuracy <- sum(diag(conf_matrix)) / sum(conf_matrix)\n",
    "  accuracies[i] <- accuracy\n",
    "  \n",
    "  # Print the nodesize and corresponding accuracy\n",
    "  cat(\"nodesize:\", nodesize, \"- Accuracy:\", accuracy, \"\\n\")\n",
    "}\n",
    "\n",
    "# Identify the nodesize with the highest accuracy\n",
    "optimal_nodesize_index <- which.max(accuracies)\n",
    "optimal_nodesize <- nodesize_values[optimal_nodesize_index]\n",
    "optimal_accuracy <- accuracies[optimal_nodesize_index]\n",
    "\n",
    "cat(\"\\nOptimal nodesize:\", optimal_nodesize, \"with Accuracy:\", optimal_accuracy, \"\\n\")\n",
    "\n",
    "# Optionally, plot accuracies against nodesize values for visual inspection\n",
    "plot(nodesize_values, accuracies, type = 'b', xlab = \"Nodesize\", ylab = \"Accuracy\", main = \"Accuracy by Nodesize in Random Forest\")\n"
   ]
  },
