   "source": [
    "# Train the Random Forest model\n",
    "rf_model <- randomForest(trainLabels ~ ., data = trainFeatures,mtry= floor(ncol(trainFeatures)/3), ntree = 200 ,nodesize = 16, type = 'classification')\n",
    "#https://www.rdocumentation.org/packages/randomForest/versions/4.7-1.1/topics/randomForest\n",
    "\n",
    "# Make predictions on the test set\n",
    "predictions <- predict(rf_model, testFeatures)\n",
    "\n",
    "# Create confusion matrix\n",
    "conf_matrix <- table(testLabels, predictions)\n",
    "conf_matrix\n",
    "\n",
    "# True Positives, True Negatives, False Positives, False Negatives\n",
    "TP <- conf_matrix[2, 2]\n",
    "TN <- conf_matrix[1, 1]\n",
    "FP <- conf_matrix[1, 2]\n",
    "FN <- conf_matrix[2, 1]\n",
    "\n",
    "# Calculate sensitivity (True Positive Rate)\n",
    "sensitivity <- TP / (TP + FN)\n",
    "\n",
    "# Calculate specificity (True Negative Rate)\n",
    "specificity <- TN / (TN + FP)\n",
    "\n",
    "# Calculate accuracy\n",
    "accuracy <- (TP + TN) / sum(conf_matrix)\n",
    "\n",
    "# Calculate precision\n",
    "precision <- TP / (TP + FP)\n",
    "\n",
    "# Calculate recall\n",
    "recall <- sensitivity\n",
    "\n",
    "# Calculate F1 score\n",
    "f1_score <- 2 * (precision * recall) / (precision + recall)\n",
    "\n",
    "# Print the evaluation metrics\n",
    "cat(\"Sensitivity (True Positive Rate):\", sensitivity, \"\\n\")\n",
    "cat(\"Specificity (True Negative Rate):\", specificity, \"\\n\")\n",
    "cat(\"Accuracy:\", accuracy, \"\\n\")\n",
    "cat(\"Precision:\", precision, \"\\n\")\n",
    "cat(\"F1 Score:\", f1_score, \"\\n\")\n",
    "\n"
   ]
  },
